Após administração, lave a seringa com água e guarde-a na respectiva caixa para que possa ser utilizada novamente.

Naproxeno é indicado para dores agudas, causadas por inflamação comopor exemplo:
- dor de garganta;
- dor e febre em adultos, inclusive para mães que não estejam amamentando: por exemplo, dor de dente, dor abdominal, sintomas da gripe e resfriado;
- dores musculares e articulares, como por exemplo, torcicolo, bursite, tendinite, sinovite, tenossinovite, dor nas costas, dor na perna, cotovelo do tenista;
- doenças reumatológicas: artrite reumatoide, osteoartrite, espondilite anquilosante, gota, artrite reumatoide juvenil;
- cólica menstrual;
- tratamento e prevenção de enxaqueca, dor de cabeça;
- após cirurgias, inclusive ortopédicas e extrações dentárias;
- dor após traumas: entorses, distensões, contusões, dor decorrente da prática esportiva.

Este medicamento é contraindicado para:
- pacientes com hipersensibilidade (alergia) ao naproxeno, naproxeno sódico ou a qualquer outro componente do medicamento;
- pacientes com histórico de asma, rinite, pólipos nasais ou urticária pelo uso de ácido acetilsalicílico ou outros anti-inflamatórios não esteroides (AINEs);
- pacientes com antecedente ou história atual de sangramento ou perfuração gastrintestinal relacionados a terapia anterior com anti-inflamatórios não esteroides;
- pacientes com antecedente ou história atual de hemorragia ou úlcera péptica ativa ou recorrente (dois ou mais episódios distintos de ulceração ou sangramento);
- pacientes com insuficiência cardíaca grave (alteração grave da função do coração);
- pacientes com insuficiência renal (alteração da função dos rins) com depuração de creatinina inferior a 30mL/min. 

Este medicamento é contraindicado para crianças menores de 2 anos.

Terapia de reposição ou suplementação hormonal (de hormônio) em pacientes com hipotireoidismo (produção insuficiente de hormônio pela glândula tireoide) de qualquer causa (exceto no hipotireoidismo transitório, durante a fase de recuperação de tireoidite subaguda - doença inflamatória da glândula tireoide). Nesta categoria incluem-se: cretinismo (condição que ocorre na infância ou na fase de amamentação devido à deficiência de hormônios da tireoide na fase fetal), mixedema (associado ao hipotireoidismo, é caracterizado pela pele seca e áspera, lábios inchados e nariz espessado) e hipotireoidismo comum em pacientes de qualquer idade (crianças, adultos e idosos) ou fase (por exemplo, gravidez); hipotireoidismo primário resultante de redução da função da tireoide; diminuição primária da tireoide; remoção total ou parcial da glândula tireoide, com ou sem bócio (aumento perceptível da tireoide); hipotireoidismo secundário (da glândula hipófise) ou terciário (do hipotálamo, que é uma região do cérebro que controla o sistema endócrino);

Supressão do TSH hipofisário (hormônio estimulante da tireoide ou tireotropina) no tratamento ou prevenção dos vários tipos de bócios eutireoidianos (bócio decorrente do aumento de TSH), inclusive nódulos tireoidianos, tireoidite linfocítica subaguda ou crônica (tireoidite de Hashimoto/tireoidite autoimune) e carcinomas foliculares e papilares (tumores malignos) da tireoide dependentes de tireotropina;

Ao diagnóstico nos testes de supressão, auxiliando no diagnóstico da suspeita de hipertireoidismo (produção excessiva de hormônio pela glândula tireoide) leve ou de glândula tireoide autônoma.

AAS Protect é indicado para diminuir o agrupamento das plaquetas, principalmente:

- Na angina de peito instável (dor no peito causada pela má circulação do sangue nas artérias coronárias);
- No infarto agudo do miocárdio;
- Para redução do risco de novo infarto em doentes que já sofreram infarto (prevenção de reinfarto);
- Após cirurgias ou outras intervenções nas artérias (por exemplo, cirurgia de ponte de safena);
- Para evitar a ocorrência de distúrbios transitórios da circulação cerebral (ataque de isquemia cerebral transitória) e de infarto cerebral após as primeiras manifestações (paralisia transitória da face ou dos músculos dos braços ou perda transitória da visão).

Nota: este medicamento não é adequado para o tratamento da dor.

Posologia: Para uso oral. Tomar os comprimidos com bastante líquido, de preferência antes das refeições. Deve-se tomar a quantidade de comprimidos indicada pelo médico.

Quando não devo usar este medicamento: Não tome AAS Protect se:
- For alérgico ao ácido acetilsalicílico ou a outros salicilatos ou a qualquer dos ingredientes do medicamento (se não tiver certeza se é alérgico ao ácido acetilsalicílico, consulte o seu médico);
- Tiver tendência para sangramentos (diátese hemorrágica);
- Tiver úlceras do estômago ou do intestino (úlceras gastrintestinais agudas);
- Já teve crise de asma induzida pelo uso de salicilatos ou outras substâncias semelhantes, especialmente anti-inflamatórios não-esteroidais;
- Estiver em tratamento com metotrexato em doses iguais ou superiores a 15 mg por semana.

Lactulona® está indicada para tratar os sintomas da constipação intestinal (prisão de ventre) e para a prevenção e o tratamento de encefalopatia hepática, incluindo as etapas de pré-coma e coma hepático.

Lactulona® é contraindicada em:
Pessoas alérgicas ou sensíveis a qualquer um dos componentes da fórmula;
Casos de intolerância a açúcares como lactose, galactose e frutose;
Casos de gastrite, úlceras pépticas, apendicite, sangramento ou obstrução intestinal, diverticulite etc.;
Preparo intestinal de pessoas que serão submetidas a exames proctológicos (colonoscopia, retosigmoidoscopia) com o uso de eletrocautério.

