Fumasil é um medicamento homeopático indicado para auxiliar no combate ao tabagismo.

Fumasil é indicado como auxiliar na redução do desejo intenso de fumar. Atua na  modificação e destruição do desejo de fumar levando ao abandono do vício, age no alívio dos sintomas decorrente do abandono do hábito de fumar e alívio dos sintomas da síndrome de abstinência.

? Promove aversão ao cheiro e ao gosto do tabaco;
? Combate insônia, depressão, falta de memória, dores de cabeça e náuseas, decorrentes do processo de tratamento;
? Reduz a vontade de comer doce;
? Ajuda a proteger o coração contra distúrbios causados pelo fumo;
? Auxilia na eliminação do pigarro, através da expectoração;
? Sem nicotina e sem efeitos colaterais.

"Passo 1: misturar duas medidas de pó descolorante para uma de água oxigenada num recipiente até que a misturinha chegue a uma consistência homogênea;
